مەدەنییەو (3) ئایەتە.
بەناوى خواى بەخشندەى میهرەبان
 ئەم سوورەتە باسى ئازادکردنى شارى (مەککە) لە بت و بتپەرستیى دەکا، کە بەڕاستیى موسڵمانان بەو ئازاد کردنەیە سەریان گەیشتە لووتکەى سەر بڵندیى و، هەر بەوەش لە دواى ئەوە لە نیوە دوورگەى عەرەبییدا ئیسلام زۆر بە پەلە پەخشبوو، بۆ دوا جاریش شیرک و بێ بڕوایى، نینۆکى کراو بێ دەست و پێ کەوت، ئینجا خەڵکى لە هەموو لایەکەوە پۆلپۆل موسوڵمان بوون و پەرچەمى (لا إله إلا الله) سەد ئەوەندەى تر بەرز بوویەوە. (ئیبن عەباس) - وەک ئیمامى (موسلیم) هێناویەتى- دەڵێ: ئەمە تەنها سوورەتێکە کە هەمووى پێکەوە بە جارێ هاتبێ. وە لەبەر گەورەیى و مەزنیى فەزیڵەتى بە چواریەکى قورئان دانراوە، هەر وەک بە ئاخر سوورەتى قورئانى پیرۆزى دادەنێت. نەسایى: 6/525. ریوایەتى دەکات. هەر وەک بە هێماى کۆچى دوایى پێغەمبەریشى دانا -صلى الله عليه وسلم- ، وەکو ئیمامى بوخاریى لە: فتح البارى: 8/606 هێناویەتى. لە لووتکەى دەسەڵاتدا تاریف و شوکرى خوا بکە:
ئادەمزاد هەرکە کەمێ بەرەو سەرکەوتن چوو، بە پێى سروشت قابیلە چەواشە ببێ و، خۆى لێبگۆرێ، جا بۆ ئەوە شتی وا ڕوو نەدا،
